text:
@vitalbaa @ramella_f Temo  non abbia capito lei.
Io non giudico le idee, prendo atto delle affermazioni. E quella in questione è chiara: il golpe in Cile evitò un male più grande.
Trattandosi di un governo democraticamente eletto (non autoritario) si tratta di un’affermazione tecnicamente fascista.

La norma governo su #delocalizzazioni approvata al Senato è una presa in giro per i lavoratori.Non previene ne’ impedisce le delocalizzazioni,si usa solo un po’ di bon ton in più.
@pdnetwork , @M5S_Senato e @articoloUnoMDP avrebbero dovuto alzare la voce, un’occasione persa
#gkn https://t.co/LKD2loWwFL
